import React from 'react';
import logo from './logo.svg';
import './App.css';
import ListItem from './ListItem/ListItem.js'
const titles = ["Title 1", "Title 2"];

function App() {
  return (
    <div className="App">
    <ListItem 
      title= {titles[0]} joe="blah"
    /> 
    <ListItem
      title= {titles[1]} tim="blah2"
    />

    </div>
  );
}

export default App;
